import styled from 'styled-components';

export const Navbar = styled.div`
  .navbar {
    overflow: hidden;
    background-color: #333;
    font-family: Arial;
  }
  .navbar a {
    float: left;
    font-size: 16px;
    color: white;
    text-align: center;
    padding: 14px 16px;
    text-decoration: none;
  }
  .dropdown {
    float: left;
    overflow: hidden;
  }
`;
